import time

class Solution:
    def findLongestSubstring(self, s):
        """
        :type s: str
        :type n: int
        :rtype: int
        """
        chars = []
        for i in range(0, len(s)):
            if s[i] in chars:
                return len(s[0:i])
            chars.append(s[i])
        return len(s[0:i+1])

    def lengthOfLongestSubstring(self, s):
        """
        :type s: str
        :rtype: int
        """
        max_len = 0
        for i in range(0, len(s)):
            if len(s[i:]) <= max_len:
                break
            max_len = max(max_len, self.findLongestSubstring(s[i:]))
        return max_len

